        let timer = setInterval(() => {
            console.log(second);

            setSecond(second=>second-1);
            console.log(second);

        }, 1000)

        if (second === 0) {
            navigate('/home', { replace: true })
            clearInterval(timer);
        }
    }, [])

    return (
        <h3>{second}秒后返回主页....</h3>
    )
}
